import React from 'react';
import './Cell.css';

class Cell extends React.Component {
    getColor(value) {
        const colors = [
            rgb(255, 255, 255),
            "rgb(255, 250, 250)",
            "rgb(255, 182, 193)",
            "rgb(255, 192, 203)",
            "rgb(255, 160, 122)",
            "rgb(250, 128, 114)",
            "rgb(205, 92, 92)",
            "rgb(178, 34, 34)",
            "rgb(165, 42, 42)"
          ];
        return colors[value].rgb;
    }

    render() {  
        const divStyle = {
            backgroundColor: this.getColor(this.props.number),
        };

        return (
            <div
                style={divStyle}
                className="cell"
            >
                {this.props.number}
            </div>
        );
    }
}

export default Cell;
